import React from "react";

export default function Home() {
  return (
    <div className="mx-auto shadow bg-dark" style={{width: '50vw', color: 'white'}}>
      <img
        src="https://raw.githubusercontent.com/drpheonixgaming2288/GRImg/main/GRLogo.png"
        class="img-fluid hover-shadow rounded"
        alt="Garage Records Logo"
        width={"200px"}
        style={{ marginTop: "30px", marginBottom: "30px" }}
      />
      <h4 className="mb-0">
        Garage Rekordz is a small record label based out of Tuttle Oklahoma and
        was originally made because an artist by the name of "Diamond" wanted to
        have a label for artists to be able to say whatever they wanted in songs
        and not get restricted or censored. The label currently consists of 5
        artists.
      </h4>
    </div>
  );
}
